  const update = () => {
    const feedback = () => console.log("feedback");
    return feedback;
  };

  return (
    <div>
      <h1>Give Feedback</h1>
      <Button handleCLick={update("good")} text={"Good"} />
      <Button handleCLick={() => {}} text={"Neutral"} />
      <Button handleCLick={() => {}} text={"Bad"} />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
